const CryptoJS = require("crypto-js")

function AESDecrypt(str) {
	var key = {};
	key['sigBytes'] = 16;
	key['words'] = [863652730, 2036741733, 1164342596, 1782662963];
	
	var aceIV = {};
	aceIV['sigBytes'] = 16;
	aceIV['words'] = [1719227713, 1314533489, 1397643880, 1749959510];
	
	var nContent = CryptoJS.AES.decrypt(str, key, {
		iv: aceIV,
		mode: CryptoJS.mode.CBC,
		padding: CryptoJS.pad.ZeroPadding
	})
	if (nContent && nContent != null) {
		try {
			var constr = CryptoJS.enc.Utf8.stringify(nContent)
			if (constr != "") {
				var data = JSON.parse(constr);
				return data;
			}
			else
				return null;
		}
		catch (err) {
			return null;
		}

	} else
		return null;
}

